let prevState = {};

function HomePage(state, action) {
  switch (action.type) {
    case "SCROLLED":
      return { scrolled: true };
    case "NOT_SCROLLED":
      return { scrolled: false };
    case "SHOW_LOGIN":
      () => {
        prevState = state;
        console.log(state);
        return { login: true };
      };
    case "HIDE_LOGIN":
      return { login: false };
    default:
      return state;
  }
}

const reducer = {
  HomePage,
};

export default reducer;
